css:
.palette {
  overflow-y: auto;
}
.palette .palette-controls {
  margin-bottom: 10px;
}
.palette input[type=checkbox] + label {
  margin-left: 8px;
}
.palette .color {
  margin-bottom: 10px;
  border: 1px solid rgba(0, 0, 0, 0.5);
  overflow: hidden;
}
.palette .color:last-child {
  margin: 0;
}
.palette .color .color {
  border: none;
  margin: 0;
}
.palette .color .color-preview {
  display: block;
  float: left;
  margin-right: 10px;
  width: 60px;
  height: 60px;
  position: relative;
}
.palette .color .color-preview:before {
  content: '';
  background: url(atom://project-palette-finder/resources/transparent-background.png);
  position: absolute;
  left: 0;
  right: 0;
  top: 0;
  bottom: 0;
}
.palette .color .color-preview:after {
  content: '';
  background: inherit;
  position: absolute;
  left: 0;
  right: 0;
  top: 0;
  bottom: 0;
}
.palette .color .color-name {
  color: #65737f;
}
.palette .color .color-line {
  padding: 5px;
  margin-top: 5px;
  margin-left: 70px;
}
.palette .color .color-path {
  color: #5786b8;
  margin-left: 10px;
}
.palette .grid .color {
  float: left;
  margin-right: 10px;
}
.palette .grid .color .color-preview {
  margin: 0;
}
.palette .grid .color .color-name,
.palette .grid .color .color-line,
.palette .grid .color .color-path {
  display: none;
}
.preview-pane {
  position: relative;
  display: -webkit-flex;
  -webkit-flex-direction: column;
}
.preview-pane .panel-heading {
  -webkit-flex-shrink: 0;
}
.preview-pane .no-results-overlay {
  visibility: hidden;
}
.preview-pane.no-results .no-results-overlay {
  visibility: visible;
}
.preview-pane .results-view {
  overflow: auto;
  position: relative;
  padding: 0 10px;
  -webkit-flex: 1;
}
.preview-pane .results-view .search-result {
  padding-top: 2px;
  padding-bottom: 2px;
}
.preview-pane .results-view .line-number {
  margin-right: 1ex;
  text-align: right;
  display: inline-block;
}
.preview-pane .results-view .selected .line-number {
  color: #dfe1e8;
}
.preview-pane .results-view .path-match-number {
  padding-left: 10px;
  color: #484f5a;
}
.preview-pane .results-view .preview {
  word-break: break-all;
  font-family: monospace;
}
.preview-pane .results-view .selected .highlight-info {
  box-shadow: inset 0 0 1px #ffffff;
}
.preview-pane .results-view .selected .highlight-error {
  box-shadow: inset 0 0 1px #ff4d4d;
}
.preview-pane .results-view .selected .highlight-success {
  box-shadow: inset 0 0 1px #72efa8;
}
.preview-pane .results-view .color-match {
  padding: 3px;
  margin: -3px 0 0;
  border-radius: 2px;
}
.color-suggestion .label {
  opacity: 1 !important;
}
.color-suggestion-preview {
  display: inline-block;
  width: 14px;
  height: 14px;
  border-radius: 50%;
}
